import React, { useState } from 'react'
import { Link } from 'react-router-dom'
import './Navigation.css'
import logoHome from "../images/mepelaozen.png"
import whatsapp from "../images/whatsapp.png"
import facebook from "../images/facebook.png"
import instagram from "../images/instagram.png"
import { useDispatch, useSelector } from 'react-redux'
import styled from 'styled-components'
import { logoutUser } from '../store/AuthSlice'
import { toast } from 'react-toastify'


function Navigation() {

  const dispatch = useDispatch()

  const [nav,setNav] = useState(false)

  const handleNav =()=>{
    setNav(!nav)
    console.log("Clicked")
  }




  const {cartTotalQuantity} = useSelector((state)=>state.cart)
  const auth = useSelector((state)=>state.auth)

  return (

    <nav className='bg-red-600'>

      <div className='container flex flex-w py-2 mx-auto'>

        <div>

          <Link to="/home"><img src={logoHome} alt="לוגו למסך הבית" className='w-[150px]'/></Link>
        </div>

        <button className='lg:hidden nline-flex items-center justify-center border h-10 w-10 text-white rounded-md outline-none focus:outline-none'>
        <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth="1.5" stroke="currentColor" className="w-6 h-6">
        <path strokeLinecap="round" strokeLinejoin="round" d="M3.75 6.75h16.5M3.75 12h16.5m-16.5 5.25h16.5" />
        </svg>
        </button>

        <div className='lg:inline-flex lg:w-auto mt-2 lg:mt-0'>
          <ul className='flex flex-col lg:flex-row space-x-2'>

            <li>
            <Link to="/mac" className='inline-flex p-4 py-2 rounded-md  font-medium bg-red-600 text-white hover:bg-blue-800'>Mac</Link>
            </li>  

            <li>
            <Link to="/watch"  className='inline-flex p-4 py-2 rounded-md font-medium text-white hover:bg-blue-800'>Watch</Link>

            </li> 

            <li>
            <Link to="/ipad"  className='inline-flex p-4 py-2 rounded-md  font-medium text-white hover:bg-blue-800'>Ipad</Link>

            </li> 

            <li>
            <Link to="/iphone" className='inline-flex p-4 py-2 rounded-md font-medium text-white hover:bg-blue-800'>Iphone</Link>
            </li> 


            <li>
            <Link to="/airpods"  className='inline-flex p-4 py-2 rounded-md font-medium text-white hover:bg-blue-800'>AirPods</Link>
            </li> 



            <li>
            <Link to="/samsung"  className='inline-flex p-4 py-2 font-medium text-white hover:bg-blue-800'>Samsung</Link>
            </li> 



            <li>
            <Link to="/case" className='inline-flex p-4 py-2 font-medium text-white hover:bg-blue-800'>אביזרים</Link>
            </li> 


            <li>
            <Link to="/cart"><svg xmlns="http://www.w3.org/2000/svg" width="35" height="35" fill="currentColor" className="bi bi-handbag-fill" viewBox="0 0 16 16">
                  <path d="M8 1a2 2 0 0 0-2 2v2H5V3a3 3 0 1 1 6 0v2h-1V3a2 2 0 0 0-2-2zM5 5H3.36a1.5 1.5 0 0 0-1.483 1.277L.85 13.13A2.5 2.5 0 0 0 3.322 16h9.355a2.5 2.5 0 0 0 2.473-2.87l-1.028-6.853A1.5 1.5 0 0 0 12.64 5H11v1.5a.5.5 0 0 1-1 0V5H6v1.5a.5.5 0 0 1-1 0V5z"/>
                  </svg> 
                    <span>{cartTotalQuantity}</span>
            </Link>         
            </li> 


          </ul>
        </div>


      </div>




    </nav>
  )
}

export default Navigation

// const Logout = styled.div`
//   color: black;
//   cursor: pointer;
// `


const AuthLinks = styled.div`
display: flex;
justify-content: end;
margin-right: 2rem;

  a{
    &:last-child{
      margin-left: 2rem;
    }
  }
`


const Links = styled.div`
  display: flex;
  div{
    cursor: pointer;
    &:last-child{
      margin-left: 2rem;
    }
  }
`
